// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PatentBot {

    struct Patent {
        uint256 patentId;
        string patentName;
        address owner;
        uint256 baseValue; // Starting value of the patent
    }

    struct License {
        uint256 licenseId;
        address licensee;
        uint256 royaltyPercentage; // Royalty percentage agreed upon
        uint256 royaltiesPaid; // Track royalties paid so far
    }

    struct CommercialActivity {
        string activityName;
        string description;
        uint256 impact; // Numeric value to show impact on patent value
    }

    mapping(uint256 => Patent) public patents; // Patent ID to Patent mapping
    mapping(uint256 => License) public licenses; // License ID to License mapping
    mapping(uint256 => CommercialActivity[]) public commercializationActivities; // Patent ID to activities

    uint256 public patentCount = 0;
    uint256 public licenseCount = 0;

    function addPatent(string memory _patentName, uint256 _baseValue) public {
        patentCount++;
        patents[patentCount] = Patent(patentCount, _patentName, msg.sender, _baseValue);
    }

    function addLicense(uint256 _patentId, uint256 _royaltyPercentage, address _licensee) public {
        require(patents[_patentId].owner == msg.sender, "Only patent owner can add license.");
        licenseCount++;
        licenses[licenseCount] = License(licenseCount, _licensee, _royaltyPercentage, 0);
    }

    function payRoyalties(uint256 _licenseId, uint256 _amount) public payable {
        require(msg.sender == licenses[_licenseId].licensee, "Only licensee can pay royalties.");
        License storage license = licenses[_licenseId];
        uint256 royaltyPayment = (_amount * license.royaltyPercentage) / 100;
        license.royaltiesPaid += royaltyPayment;
    }

    function logActivity(uint256 _patentId, string memory _activityName, string memory _description, uint256 _impact) public {
        require(patents[_patentId].owner == msg.sender, "Only patent owner can log activities.");
        commercializationActivities[_patentId].push(CommercialActivity(_activityName, _description, _impact));
    }

    function calculatePatentValue(uint256 _patentId) public view returns (uint256) {
        Patent memory patent = patents[_patentId];
        uint256 totalImpact = 0;

        for (uint256 i = 0; i < commercializationActivities[_patentId].length; i++) {
            totalImpact += commercializationActivities[_patentId][i].impact;
        }

        return patent.baseValue + totalImpact;
    }
}

